import React from "react";

export default function FinishScreen({ score }) {
  return (
    <div className="finish-container">
      <p>
        YOU SCORED {score} OUT OF 280 POINTS ({Math.trunc((score / 280) * 100)}
        %)
      </p>
    </div>
  );
}
